import React from 'react';


class CountryFilter extends React.Component {
    render() {
        const {countryList} = this.props;
        const Countries = ({ countryList }) => {
            countryList.map((country) => (
                <li>{country}</li>
            ));
        }  
        return (
            <div>
                <h3>
                    COUNTRY
                </h3>
                <ul>
                    {Countries}
                </ul>
            </div>
        );
    }
}

export {CountryFilter}
